import React from "react";
import SideBarItem from "./sideBarItem";

const style = {
	width: "50vw",
	height: "50vh",
	position: "relative",
	left: "0",
	backgroundColor: "white"
};

export default function SideBar(props) {
	return (
		<div id="sideBar">
            <img src={props.logo} alt="Shed Logo"
            style={logoStyle} />
			{props.sections.forEach(section => {
				return <SideBarItem title={section} />;
			})}
		</div>
	);
}
